import React from 'react'
import classes from './DibsBet.css'

const DibsBet = props =>(   
    <div>
        {
            props.userDibsBet.map((bet, index)=>{
                return(
                    <div key={index} className={'classes.dib_' + bet + ' classes.user_dib_' + bet}>
                        {bet}
                    </div>
                )
            })
        }
        {
            props.enemyDibsBet.map((bet, index)=>{
                return(
                    <div key={index} className={'classes.dib_' + bet + ' classes.enemy_dib_' + bet}>
                        {bet}
                    </div>
                )
            })
        }
    </div>
)

export default DibsBet
